import Link from 'next/link';
import Layout from '../components/Layout'


export const index = () => {
    return (
        <>
            <Layout>
                <h1 className="text-blue-500">This is the home page!</h1>
                <Link href='/about'><a className="text-green-300">About Page</a></Link>
            </Layout>
        </>
    );
}

export default index;
